INSERT INTO `wp_posts` VALUES (1,1,'2018-05-07 23:00:49','2018-05-07 21:00:49','Witaj w WordPressie. To jest twój pierwszy wpis. Zmodyfikuj go lub usuń, a następnie rozpocznij pisanie!','Witaj, świecie!','','publish','open','open','','witaj-swiecie','','','2018-05-07 23:00:49','2018-05-07 21:00:49','',0,'ec2-18-184-37-34.eu-central-1.compute.amazonaws.com/?p=1',0,'post','',41),(2,1,'2018-05-07 23:00:49','2018-05-07 21:00:49','To jest przykładowa strona. Strony są inne niż wpisy na blogu, ponieważ nie tylko znajdują się zawsze w jednym miejscu, ale także pojawiają się w menu witryny (w większości motywów). Większość użytkowników umieszcza na swoich witrynach stronę z informacjami o sobie, dzięki którym przedstawiają się odwiedzającym ich witrynę. Taka strona może zawierać na przykład taki tekst:\n\n<blockquote>Cześć! Za dnia jestem gońcem, a nocą próbuję swoich sił w aktorstwie. To jest moja witryna. Mieszkam w Los Angeles, mam wspaniałego psa, który wabi się Jack i lubię pi&#241;a coladę (a także spacery, gdy pada deszcz).</blockquote>\n\n... lub taki:\n\n<blockquote>Firma Wihajstry XYZ została założona w 1971 roku i od początku swojego istnienia zajmuje się produkcją najlepszych wihajstrów. W naszej siedzibie w Gotham City pracuje ponad 2000 osób, które zajmują się robieniem całej masy fantastycznych rzeczy dla mieszkańców Gotham.</blockquote>\n\nJako nowy użytkownik WordPressa powinieneś przejść do <a href=\"ec2-18-184-37-34.eu-central-1.compute.amazonaws.com/wp-admin/\">swojego kokpitu</a>, aby usunąć tę stronę i utworzyć nowe strony z własną treścią. Baw się dobrze!','Przykładowa strona','','publish','closed','open','','przykladowa-strona','','','2018-05-07 23:00:49','2018-05-07 21:00:49','',0,'ec2-18-184-37-34.eu-central-1.compute.amazonaws.com/?page_id=2',0,'page','',0),(3,1,'2018-05-07 23:00:58','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','open','open','','','','','2018-05-07 23:00:58','0000-00-00 00:00:00','',0,'ec2-18-184-37-34.e